import React from 'react';
import PropTypes from 'prop-types'; 
import FileIcon from './FileIcon';
import FileName from './FileName';
import CommitMessage from './CommitMessage';
import Time from './Time';

const FileListItem = ({ file }) => (
    <div className="file-list-item">
        <div className="file-icon"><FileIcon file={file} /></div>
        <div className="file-name"><FileName file={file} /></div>
        <div className="commit-message"><CommitMessage commit={file.latestCommit} /></div>
        <div className="time"><Time time={file.updated_at}/> </div>
    </div>
)

FileListItem.propTypes = {
    file: PropTypes.object.isRequired
}

export default FileListItem


